// シェーダファイルへのパス (要追加)
import VERT_FILE from "./assets/main.vert"
import FRAG_FILE_00 from "./assets/main_00.frag"
import FRAG_FILE_01 from "./assets/main_01.frag"

// 各フィルタを実装する頂点シェーダーとフラグメントシェーダの組 (要追加)
export let filePathList = [
  {
    "vert": VERT_FILE,
    "frag": FRAG_FILE_00,
    "remarks": "白黒のフィルタ"
  },
  {
    "vert": VERT_FILE,
    "frag": FRAG_FILE_01,
    "remarks": "なにかコメントがあれば(どういったフィルタかの説明など)"
  },
]
